import React from 'react';
import logo from './logo.svg';
import './App.css';
import axios from 'axios';
import {LedgerDetail} from "./model/LedgerDetail";

function getData(): Promise<[LedgerDetail]> {
  return axios.get("http://localhost:8080/invoices").then(response => {
    return response.data.map((value: any) => {
      return new LedgerDetail(
          value.amount,
          value.currency,
          value.is_credit,
          value.description,
          value.created_at
      );
    });
  }).catch(error => {
    console.error(error)
    return [];
  });
}

function App() {
  const data = getData();
  console.log(data);
  return (
    <div className="App">
      <header className="App-header">
        <p className="simple-header">My Ledger</p>

      </header>
    </div>
  );
}

export default App;
